import React from "react";

function About() {
  return (
    <div>
      <p  style={{padding: "2px"}}>
        Welcome to our Delicioursard grocery store ! We are a family-owned and operated
        business that has been serving our community for over 50 years. Our
        store offers a wide variety of fresh produce, vegetables, fruits, and pantry
        essentials at affordable prices. We pride ourselves on offering
        high-quality products and exceptional customer service. Our dedicated
        team of employees works hard to ensure that our shelves are always
        well-stocked and that our customers are satisfied with their shopping
        experience. We believe in supporting local farmers and businesses and
        therefore a significant portion of our products are sourced from local
        producers. In addition to our in-store shopping options, we also offer
        online ordering and home delivery for your convenience. Thank you for
        choosing our store for all of your grocery needs. We look forward to
        serving you!"
      </p>
    </div>
  );
}

export default About;
